import "./Login.css";
import Card from "../UI/card";
function Login() {
  return (
    <Card className="login">
      <form>
        <div className="email">
          <label>E-mail</label>
          <input></input>
        </div>
        <div className="password">
          <label>Password</label>
          <input></input>
        </div>
        <div className="btn">
          <button>Login</button>
        </div>
      </form>
    </Card>
  );
}
export default Login;
